export interface File {
    url: string;
    index?: number;
    checksum?: string;
    checksumType?: string;
    contentLength?: string;
    resourceId?: string;
    encoding?: string;
    compression?: string;
    contentType?: string;
}
export interface MetaDataBase {
    name: string;
    type: "dataset" | "algorithm" | "container" | "workflow" | "other";
    description?: string;
    dateCreated: string;
    author: string;
    license: string;
    copyrightHolder?: string;
    workExample?: string;
    links?: Array<{
        [name: string]: string;
    }>;
    inLanguage?: string;
    tags?: string;
    price: number;
    files: File[];
    checksum?: string;
    encryptedFiles?: any;
}
export interface Curation {
    rating: number;
    numVotes: number;
    schema?: string;
}
export interface AdditionalInformation {
    updateFrecuency: string;
    structuredMarkup: Array<{
        uri: string;
        mediaType: string;
    }>;
    checksum: string;
}
export interface MetaData {
    additionalInformation: AdditionalInformation;
    base: MetaDataBase;
    curation: Curation;
}
